function Home() {
  const history = useHistory();
  console.log(useHistory(),"here");
    return <>
    <p>Home page</p>
    <button onClick={history.goBack}>Forward</button>
    <button onClick={history.goForward}>Backward</button>
    </>
}
export default Home;
